sys_variable_value.value:
(function execute(inputs, outputs) {
    if (!gs.hasRole("sn_jha_spoke.user"))
        throw 'Following role is required to execute the action: sn_jha_spoke.user';
    inputs = JHAUtils.trimInputs(inputs);
    var mandatory_fields = {
        "Account ID": inputs.account_number,
        "Amount": inputs.amount,
        "Remarks": inputs.remarks
    }
    var mandatory_field_result = JHAUtils.checkMandatoryFields(mandatory_fields);
    if (mandatory_field_result != "")
        throw "Following fields are mandatory - " + mandatory_field_result;
    outputs.account_id = GlideStringUtil.escapeHTML(inputs.account_number);
    outputs.account_type = "D";
    outputs.amount = GlideStringUtil.escapeHTML(inputs.amount);
    outputs.effective_date = new GlideDateTime().getDate().toString();
    outputs.remarks = GlideStringUtil.escapeHTML(inputs.remarks);
})(inputs, outputs);

