sys_variable_value.value:
(function execute(inputs, outputs) {
    var response = inputs.response;
    var xmlDoc = new XMLDocument2();
    xmlDoc.parseXML(response);
    if (inputs.status_code == 200) {
        outputs.transaction_details = {
            transaction_receipt_id: xmlDoc.getNodeText("/s:Envelope/s:Body/TrnAddResponse/TrnRcptId"),
            status: xmlDoc.getNodeText("/s:Envelope/s:Body/TrnAddResponse/RsStat"),
            sequence_number: xmlDoc.getNodeText("/s:Envelope/s:Body/TrnAddResponse/SeqNum")
        }
    } else {
        var error_message = JHAErrorHandler.handleErrors(xmlDoc.getNodeText(
            "/s:Envelope/s:Body/s:Fault/detail/HdrFault/FaultRecInfoArray/FaultMsgRec/ErrDesc"
        ));
        throw new Error(error_message);
    }
})(inputs, outputs);

